import React from 'react';
import './NavAuthBlock.css';

const NavAuthBlock = () => {
    return (
        <div className="nav-movie">
            <button className="header__registration">Регистрация</button>
            <button className="header__login">Войти</button>
        </div>
    );
};

export default NavAuthBlock;
